import React from "react";
import axios from "axios";
import Nav from "./navVendedor";
import './styles/dashVendedor.css';

export class DashVendedor extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      producto: [],
    };
  }

  async componentDidMount() {
    const producto = await axios.get(`http://localhost:5000/producto/search/${this.props.match.params.id}`);
    this.setState({ producto: producto.data });
  }

  render() {
    return (
    <>
      <Nav/>
        <main>
            <div className="cards">            
                <div className="card-single">
                    <div>
                        <h1>54</h1>
                        <span>Customers</span>
                    </div>
                    <div>
                        <span className="las la-users"></span>
                    </div>
                </div>
                <div className="card-single">
                    <div>
                        <h1>79</h1>
                        <span>Projects</span>
                    </div>
                    <div>
                        <span className="las la-clipboard"></span>
                    </div>
                </div>
                <div className="card-single">
                    <div>
                        <h1>124</h1>
                        <span>Orders</span>
                    </div>
                    <div>
                        <span className="las la-shopping-bag"></span>
                    </div>
                </div>
                <div className="card-single">
                    <div>
                        <h1>6K</h1>
                        <span>Income</span>
                    </div>
                    <div>
                        <span className="las la-google-wallet"></span>
                    </div>
                </div>
            </div>

            <div className="recent-grid">
                <div className="projects">
                    <div className="card-header-dash">
                    <div className="card-header-dash"></div>
                    </div>
                </div>
                <div className="customers">

                </div>
            </div>
        </main>  
    </>
    );
  }
}

export default DashVendedor;
